import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: 1,
      data: new Date(2021, 7, 14),
      title: "Kitchen Tools",
      amount: 70,
    },
    {
      id: 2,
      data: new Date(2021, 9, 14),
      title: "Kitchen Tools",
      amount: 100,
    },
    {
      id: 1,
      data: new Date(2019, 6, 14),
      title: "Kitchen Tools",
      amount: 170,
    },
    {
      id: 1,
      data: new Date(2018, 8, 14),
      title: "Kitchen Tools",
      amount: 190,
    },
  ];

  return (
    <div>
      <ExpenseItem ></ExpenseItem>
    </div>
  );
}

export default App;
